def astype_nansafe(arr, dtype, copy=True, skipna=False):
    if is_extension_array_dtype(dtype):
        return dtype.construct_array_type()._from_sequence(arr, dtype=dtype, copy=copy)

    if not isinstance(dtype, np.dtype):
        dtype = np.dtype('O') if is_object_dtype(dtype) else pandas_dtype(dtype)

    if is_categorical(arr):
        if is_integer_dtype(dtype) or is_bool_dtype(dtype):
            if skipna:
                mask = notna(arr)
                return pd.Categorical.from_codes(
                    arr.codes[mask],
                    dtype,
                    categories=arr.categories,
                    ordered=arr.ordered,
                )
            else:
                return arr.astype(dtype)

    if is_interval_dtype(dtype) and is_numeric_dtype(arr):
        return arr.array.to_pandas()

    if (
        (is_datetime64_dtype(dtype) or is_timedelta64_dtype(dtype))
        and (is_object_dtype(arr) or is_object_dtype(dtype))
        and not copy
    ):
        return arr.view(dtype)

    if is_decimal_dtype(arr) and is_bool(dtype):
        return arr._values.astype('bool')
